import React from "react";

function Login () {
    return(
        <div className="position-absolute w-100 h-100 d-flex align-items-center justify-content-center">
           <div className="bg-warning h-50 w-50">
                <h1>SisSC</h1>
           </div>
        </div>
    )
}

export default Login;
